import React from "react";
import PropTypes from "prop-types";
import styled from "styled-components";

const Line = styled.span`
  border-left: 3px solid #000;
  display: inline-block;
  height: 60px;
  margin: 0 20px;
`;

const StyledImage = styled.img`
  position: relative;
  width: 50px;
  height: 50px;
  margin-top: -8px;
  margin-left: -5px;
  border: 3px solid blue;
`;

export const ALIGN_SKILL = {
  LEFT: "left",
  MIDDLE: "middle",
  RIGHT: "right"
}

const Skill = () => {
  return (
    <div
      style={{
        width: "50px",
        height: "auto",
        marginLeft: "5px",
      }}
    >
      <Line></Line>
      <StyledImage
        src={require("../../asserts/data/images/Paladin/ability_paladin_speedoflight.jpg")}
      />
    </div>
  );
};

Skill.propTypes = {
  character: PropTypes.string,
};

export default Skill;
